  [],\n\t\"revision_timestamp\": \"2015-05-07T01:20:06.000715\",\n\t\"name\": \"robust-six-axis-force-and-torque-transducer-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The use of automated robotic tooling is
  required in a number of space missions. It is possible to have better tool control
  if the robotic arm could report loads experienced by the tooling. ATI Industrial
  Automation proposes to develop and prove technologies to be used in a low weight,
  low outgassing multi-axis force and torque transducer that can be used at cryogenic
  temperatures. The transducer will require strain gage excitation electrical power
  and output strain gage level voltage signals. These signals can be digitized and
  then mathematically transformed into values that represent the transducer's loads
  as forces in the X, Y, and Z axes and torques about the X, Y, and Z axes. The primary
  goal of this phase I proposal is to develop, produce, and characterize a proof of
  concept simplified transducer that can survive the harsh environments expected to
  be encountered on a Mars lander mission.rnrnThe technical objectives are:rn1. A
  transducer element capable of surviving temperatures from -135&amp;#176;C to +125&amp;#176;C.rn2.
  The transducer element in objective 1 with temperature compensation to minimize
  span and offset drift from -80&amp;#176;C to +70&amp;#176;C.rn3. The transducer
  element in objective 2 constructed so that it will sense properly in an atmospheric
  vacuum of 1E-5 torr.rn4. The transducer element in objective 3 made of low-outgassing
  materials that are compatible with an interplanetary sample-collecting mission.rn5.
  The transducer element in objective 4 constructed so it can survive vibrations of
  a rocket launch.rn6. The transducer element in objective 5 instrumented with redundant
  sets of strain gages.rnrnTwo transducers will be built and tested: one with foil
  strain gages and one with silicon strain gages.\",\n\t\"license_title\": \"U.S.
